import { Injectable } from '@angular/core';
import { Article } from '../interfaces/article';
import { Observable } from 'rxjs';
import { envConfig } from 'src/app/environment/config';

import { HttpClient, HttpHeaders } from '@angular/common/http';
import { Category } from '../enums/category';

@Injectable({
  providedIn: 'root',
})
export class NewsService {
  private rootUrl = 'http://sanger.dia.fi.upm.es/pui-rest-news';
  private articleListUrl = `${this.rootUrl}/articles`;
  private articleUrl = `${this.rootUrl}/article`;

  private apiKey?: string;

  constructor(private http: HttpClient) {}

  private httpOptions = {
    headers: new HttpHeaders({
      'Content-Type': 'application/json',
      Authorization: 'PUIRESTAUTH apikey=' + envConfig.apiKey,
    }),
  };

  public setUserApiKey(apiKey: string) {
    this.apiKey = apiKey;
    this.httpOptions = {
      headers: new HttpHeaders({
        'Content-Type': 'application/json',
        Authorization: 'PUIRESTAUTH apikey=' + this.apiKey,
      }),
    };
  }

  public setAnonymousApiKey() {
    this.setUserApiKey(envConfig.apiKey);
  }

  getArticles(): Observable<Article[]> {
    return this.http.get<Article[]>(this.articleListUrl, this.httpOptions);
  }

  deleteArticle(article: Article | number): Observable<Article> {
    const id = typeof article === 'number' ? article : article.id;
    const url = `${this.articleUrl}/${id}`;
    return this.http.delete<Article>(url, this.httpOptions);
  }

  getArticle(id: number): Observable<Article> {
    const url = `${this.articleUrl}/${id}`;
    return this.http.get<Article>(url, this.httpOptions);
  }

  updateArticle(article: Article): Observable<Article> {
    return this.http.post<Article>(this.articleUrl, article, this.httpOptions);
  }

  createArticle(article: Article): Observable<Article> {
    return this.http.post<Article>(this.articleUrl, article, this.httpOptions);
  }

  private article: Article = {
    id: 1,
    title: 'Banana',
    subtitle: 'The great',
    category: Category.National,
    abstract:
      'Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes Yes ',
    body: 'A very great banana',
    update_date: new Date(),
    image_data:
      '',
    image_media_type: 'image/jpeg',
    thumbnail_image:
      '',
    thumbnail_media_type: 'image/jpeg',
  };

  private articles: Article[] = [
    { ...this.article },
    { ...this.article },
    { ...this.article },
    { ...this.article },
  ];
}
